import React, { Component } from 'react';

class Articles extends Component {
    constructor(props) {
        super(props);
        this.state = {
            viewStatus : null
        };
        this.targetToRendering = this.targetToRendering.bind(this);
    }

    targetToRendering() {
        const newArticle = this.props.getArticleLists.map((element, index) => {
            return (
                <div key = {index} className = "newArticle">
                    <div>{element.title}</div>
                    <div>{element.source.name}</div>
                    <div>{element.author}</div>
                    <div>{element.publishedAt}</div>
                    {this.props.onViewStatus ? "나는 리스트다." : "나는 카드다."}
                </div>
            );
        });

        return newArticle;
    }

    render() {
        return (
            <div className = {this.props.onData ? "colorBlue" : "colorRed"}>
                {this.targetToRendering()}
            </div>
        );
    }
}

export default Articles;
